import * as React from 'react';
import { Chart } from 'react-google-charts';
import './Userhome.css'

export const data = [
    ["Task", "Hours per Day"],
    ["Utilities", 200],
    ["Entertainment", 200],
    ["Food", 400],
    ["Transportation", 250],
    ["Miscellaneous", 350],
    ["Rent", 800]
  ];

  export const options = {
    title: "Expenses",
    titleTextStyle: {
        color: "red",               // color 'red' or '#cc00cc'
        fontName: "Courier New",    // 'Times New Roman'
        fontSize: 25,               // 12, 18
        bold: true,                 // true or false
        italic: true                // true of false
    },
    is3D: true,
    'chartArea': {'width': '100%', 'height': '80%'},
  };

const Userhome = () => {
    return (
        <div>

            <Chart className='piechart'
                chartType='PieChart'
                data={data}
                options={options}
                width={"800px"}
                height={"500px"}
            />
        </div>
    )
}

export default Userhome;
